import React from "react"; 
import "./ProfileButton.css"

const ProfileButton = () => {

    return (
        <button class="profile-button">
            <img src="images/user.jpg" alt="" />
            <span class="profile-name">Hi John</span>
        </button>
    );
};

export default ProfileButton;
